import React from 'react';
import PageTemplate from '../../templates/PageTemplate';
import { Header } from '../../components/organism';
import { PokemonDetails } from '../../containers'

const Pokemon = () => {
    return (
        <PageTemplate
            header={<Header rightAction="/mypokemon" leftAction="/"/>}>
            <PokemonDetails/>
        </PageTemplate>
    )
}

export default Pokemon;
